        "\n",
        "# Add price_per_km feature\n",
        "car_dataset['price_per_km'] = car_dataset['Selling_Price'] / (car_dataset['Kms_Driven'] + 1)\n",
        "\n",
        "# External factor: assume we have avg fuel price (you can mock it if no data)\n",
        "fuel_prices = {'Petrol': 1.2, 'Diesel': 1.0, 'CNG': 0.8}\n",
        "car_dataset['fuel_cost_index'] = car_dataset['Fuel_Type'].map(fuel_prices)"
