        "    model.fit(X_train, Y_train)\n",
        "    quantile_models[q] = model\n",
        "\n",
        "low = quantile_models[0.1].predict(X_test)\n",
        "mid = quantile_models[0.5].predict(X_test)\n",
        "high = quantile_models[0.9].predict(X_test)\n",
        "\n",
        "for i in range(5):\n",
        "    print(f\"Predicted range: {low[i]:.0f} - {high[i]:.0f}, Median: {mid[i]:.0f}, True: {Y_test.iloc[i]}\")"
