        "%%writefile app.py\n",
        "\n",
        "import streamlit as st\n",
        "import pandas as pd\n",
        "import shap\n",
        "import joblib\n",
        "\n",
        "\n",
        "model = joblib.load(\"car_price_model.pkl\")\n",
        "X_train = joblib.load(\"X_train.pkl\")\n",
        "\n",
        "st.title(\"Car Price Prediction App\")\n",
